const pokemon = importAll(
  require.context("../static/pokemon/", false, /\.(png|jpe?g|svg)$/)
);

class App extends React.Component {
  render() {
    console.log(`$pokemon/0002_000_mf_n.png`);
    return <img src={`$pokemon/0002_000_mf_n.png`} />;
  }
}

export default App;
